import '../App.css';
import "../tailwind.output.css"
import Header from "../components/Header";
import Card from "../components/Card";
import Footer from "../components/Footer";

function Main() {

  return (

      <div className="bg-white">

        <Header/>

        <Card/>

        <Footer/>

    </div>
  );
}

export default Main;
